import React from 'react'
import "./AddNewCar.css";

const AddNewCar = () => {
  const fuelOptions = ["petrol", "diesel", "electric", "gas", "other"]

  return (
    <div className='add-car-form-container'>
        <div class="main">  	
		<input type="checkbox" id="chk" aria-hidden="true" />

			<div class="add-car">
				<form>
					<label for="chk" aria-hidden="true">Add new car</label>
					<input 
                    type="text" 
                    name="brand" 
                    placeholder="Brand" 
                    required='' 
                    className="input" 
                    // onChange={({ target }) =>
                    // setCredentialsRegister({ ...credentialsRegister, first_name: target.value })
                    // }
                    />
                    <input 
                    type="text" 
                    name="model" 
                    placeholder="Model" 
                    required='' 
                    className="input" 
                    // onChange={({ target }) =>
                    // setCredentialsRegister({ ...credentialsRegister, last_name: target.value })
                    // }
                    />
                    <input 
                    type="text" 
                    name="production_year" 
                    placeholder="Production Year" 
                    required='' 
                    className="input" 
                    // onChange={({ target }) =>
                    // setCredentialsRegister({ ...credentialsRegister, last_name: target.value })
                    // }
                    />
                    <input 
                    type="text" 
                    name="country_of_origin" 
                    placeholder="Country of origin" 
                    required='' 
                    className="input" 
                    // onChange={({ target }) =>
                    // setCredentialsRegister({ ...credentialsRegister, last_name: target.value })
                    // }
                    />
                    <select
                    className="input" >
                      {
                        fuelOptions.map((option,index) => (
                          <option key={index}>{option}</option>
                        ))
                      }
                    </select>
					<button>Add</button>
				</form>
			</div>
	</div>
    </div>
  )
}

export default AddNewCar
